def countExcellentPairs(nums, k) -> int:
    nums = [*set(nums)]
    n=len(nums)
    for a in range (n):
        t=0
        while (nums[a]):
            t += (nums[a]&1)
            nums[a] = nums[a] >> 1
        nums[a]=t
    ans = 0                     
    nums.sort()
    n=len(nums)
    for i in nums:
        x=k-i
        if x in nums:ans+=n-nums.index(x)
    return ans





